import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="content">
        {/* ← Aquí agrupamos header + main */}
        <div className="center-group">
          <div className="header-text">
            TECNOLÓGICO DE MONTERREY
          </div>
          
          <div className="main-text">
            LEM129
          </div>
        </div>

        {/* ← El footer queda como estaba */}
        <div className="footer-text">
          VEINTINUEVE DE JUNIO DEL DOSMILVEINTICINCO
        </div>
      </div>
      
      <div className="save-the-date-section">
        <div className="save-the-date-content">
          <div className="save-text">Save</div>
          <div className="the-date-text">the Date</div>
          <div className="icon-container">
            <img src="/svg/icono.svg" alt="Icono" className="date-icon" />
          </div>
          <div className="photo-placeholder">
            {/* Placeholder rojo para la foto */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
